import React from "react";

export default function Navbar(){
    return (
        <div className="Navbar">
            <h1>Navbar</h1>
            <ul>
                <li>Films</li>
                <li>Starships</li>
                <li>Vehicles</li>
            </ul>
        </div>
    )
}
